  false,\n\t\"url\": null,\n\t\"notes\": \"This unpublished report identifies vegetation
  types that burned during the 2007 wildfire at Okefenokee NWR and detects patterns
  in burn severity and pre-burn vegetation type. On 16 April 2007 a fire ignited northwest
  of the Okefenokee National Wildlife Refuge (ONWR), Georgia. The fire spread to the
  Refuge by 19 April, reaching a burn perimeter of 160,616 ha before being extinguished
  by precipitation on 21 June 2007. This report documents vegetation regrowth in the
  Refuge with a map developed with satellite imagery collected in May 2008 and classified
  with unsupervised and supervised procedures. We compared this 2008 vegetation map
  with classifications of satellite imagery collected during 1990 and 2001 and with
  maps estimating severity of fires that burned the Refuge during 2007. Our goal was
  to identify 1) vegetation communities that burned in 2007, 2) trends in pre-burn
  vegetation type, burn severity, and pattern detectable with remotely acquired data,
  and 3) relationships of post-fire vegetation recovery to burn pattern and arrangement
  of burned and non-burned areas. We also compared post-burn vegetation regrowth with
  spatial data of historical logging activity and hydroperiod profiles to determine
  relationships of vegetation recovery and site condition history.\",\n\t\"owner_org\":
